import style from "./Card.module.scss";
import Rate from "../../Components/UI/Rate/Rate"

//  {
//     id: 1,
//     title: "GREYHOUND",
//     about: "Drama, Action | 2020",
//     rate: 4,
//   },

const Card = ({ data }) => {
  return (
      <div className={style.card}>
          <div>
            <img className={style.image} src={data.image} />
              <Rate />
          </div>
          <div>
            <span>{data.title}</span>
          </div>
      </div>
  );
};

export default Card;
